import React from 'react';
import Navbar from '../Navbar';
import Review from '../Review';
import Footer from '../Footer';

const Reviewssss = () => {
  return (
    <>
        <Navbar/>
        <Review/>
        <Footer/>
    </>
  )
}

export default Reviewssss;
